1	1	returns	Política de devoluciones y reembolsos	<p>All orders can be canceled until they are shipped. If your order has been paid and you need to change or cancel it, please contact us within 12 hours of placing it. We have a 14-day return policy, which means you have 14 days after receiving your item to request a return.</p>\n<p>To be eligible for a return, your item must be in the same condition that you received it, unworn or unused, with tags, and in its original packaging. You'll also need the receipt or proof of purchase.</p>\n<p>To start a return, you can contact us at&nbsp;support@purrteam.com&nbsp;If your return is accepted, we'll send you a return shipping label, as well as instructions on how and where to send your package. Items sent back to us without first requesting a return will not be accepted.</p>\n<h3>Damages and issues</h3>\n<p>Please inspect your order upon reception and contact us immediately if the item is defective, damaged or if you receive the wrong item, so that we can evaluate the issue and make it right.</p>\n<h3>Exceptions / non-returnable items</h3>\n<p>Certain types of items cannot be returned, like perishable goods (such as food, flowers, or plants), custom products (such as special orders or personalized items), and personal care goods (such as beauty products). We also do not accept returns for hazardous materials, flammable liquids, or gases. Please get in touch if you have questions or concerns about your specific item.</p>\n<p>Unfortunately, we cannot accept returns on sale items or gift cards.</p>\n<h3>Exchanges</h3>\n<p>The fastest way to ensure you get what you want is to return the item you have, and once the return is accepted, make a separate purchase for the new item.</p>\n<h3>Refunds</h3>\n<p>We will notify you once we've received and inspected your return, and let you know if the refund was approved or not. If approved, you'll be automatically refunded on your original payment method. Please remember it can take some time for your bank or credit card company to process and post the refund too. fytfytfy</p>	f	t	2025-08-09 03:49:55.446753-04	2025-08-09 03:55:48.4732-04
